/*!
Main Script
*/
$(document).on('ready', function () {

    /*=================================
   Sticky Header Starts
   =================================*/
    function fixedHeader() {
        var sticky = $('header'),
            scroll = $(window).scrollTop();

        if (scroll >= 10) sticky.addClass('fixHeader');
        else sticky.removeClass('fixHeader');
    };

    $(window).scroll(function (e) {
        fixedHeader();
    });
    /* Sticky Header Ends */


    /* Form Feild Functionality */
    $(document).on('input', '.form-field', function () {
        if ($(this).val().length > 0) {
            $(this).addClass('field--not-empty');
        } else {
            $(this).removeClass('field--not-empty');
        }
    });
    /* // Form Feild Functionality */

    $('#header').load('header.html', function () {
        fixedHeader();

        $(".scrollbar").mCustomScrollbar({
            // setWidth: '2px'
        });
    });

    $('#footer').load('footer.html', function () { });

    // $('.salon-side-bar').load('../app/dashboard/dashboard.component.html', function () { });

    $('[data-toggle="tooltip"]').tooltip()

    // menu sidebar start
    $(".side-menu").click(function () {
        var editpopup = $(this).attr("data-name");
        console.log(editpopup);
        $('#' + editpopup).addClass('mobile-side-in');
        $('.overlay').addClass('overlay-in');
    });

    $(".close-btn, .overlay").click(function () {
        $('.overlay').removeClass('overlay-in');
        $('.mobile-side').removeClass('mobile-side-in');
    });
    // menu sidebar end


    // login successful start
    $(".succe-msg-slide").click(function () {
        $('.login-succes').addClass('login-succes-in');
        $('.succe-overlay').addClass('succe-overlay-in');
    });

    $(".dismiss-btn").click(function () {
        $('.succe-overlay').removeClass('succe-overlay-in');
        $('.login-succes').removeClass('login-succes-in');
    });
    // // login successful end

    // status start
    $(document).on('click', '.yur-mail-rig .status', function () {
        $(this).parents(".yur-mail-box").siblings().find('.status-list').removeClass('status-list-disp');
        $(this).next('.status-list').toggleClass('status-list-disp');
        return false;
    });

    $(document).on('click', '.status-list', function (e) {
        e.stopPropagation();
    });

    console.log('on dashboard page')

    $(document).on('click', function () {
        $('.status-list').removeClass('status-list-disp');
    });
    // status end




    $(document).on('click', '.suprt-service', function () {
        $('.support').addClass('suprt-box');
    });

    $(document).on('click', '.support-head i', function () {
        $('.support').removeClass('suprt-box');
    });

    // upload js start
    function readURL(input) {
        if (input.files && input.files[0]) {
            var reader = new FileReader();
            reader.onload = function (e) {
                $('#imagePreview').css('background-image', 'url(' + e.target.result + ')');
                $('#imagePreview').hide();
                $('#imagePreview').fadeIn(650);
            }
            reader.readAsDataURL(input.files[0]);
        }
    }
    $("#imageUpload").change(function () {
        readURL(this);
    });
    // upload js end

    /* Container Count Functionality */
    $(document).on('click', '.count-up', function () {
        let input = $(this).parent('.container-count-box').find('.container-count');
        let downBtn = $(this).parent('.container-count-box').find('.count-down');
        let count = parseInt(input.html());
        // console.log(count);

        count = count + 1;
        count = count > 9 ? count : '0' + count;
        // console.log(count);
        input.html(count);
        $(downBtn).show();
        $(input).css('display', 'inline-block');
    });

    $(document).on('click', '.count-down', function () {
        let input = $(this).parent('.container-count-box').find('.container-count');
        let count = parseInt(input.html());
        count = count - 1;
        count = count > 9 ? count : '0' + count;
        // console.log(count);
        input.html(count);
        if (count == 0) {
            $(this).hide();
            $(input).css('display', 'none');
        }
    });
    /* // Container Count Functionality */

    /* Password View */
    $(document).on('click', '.view-pass', function () {

        inp = $(this).parents('.form-group').find('input');
        type = inp.attr('type');

        if (type == 'password') {
            inp.attr('type', 'text');
            $(this).removeClass('icon-hide').addClass('icon-seen');
        } else {
            inp.attr('type', 'password');
            $(this).removeClass('icon-seen').addClass('icon-hide');
        }
    });
    /* // Password View */


    // 3d hover effect start
    const docStyle = document.documentElement.style
    const aElem = document.querySelector('.hover-rotate')
    if (aElem != null) {
        const boundingClientRect = aElem.getBoundingClientRect();

        aElem.onmousemove = function (e) {

            const x = e.clientX - boundingClientRect.left
            const y = e.clientY - boundingClientRect.top

            const xc = boundingClientRect.width / 2
            const yc = boundingClientRect.height / 2

            const dx = x - xc
            const dy = y - yc

            docStyle.setProperty('--rx', `${dy / -1}deg`)
            docStyle.setProperty('--ry', `${dx / 10}deg`)

        }

        aElem.onmouseleave = function (e) {

            docStyle.setProperty('--ty', '0')
            docStyle.setProperty('--rx', '0')
            docStyle.setProperty('--ry', '0')

        }

        aElem.onmousedown = function (e) {

            docStyle.setProperty('--tz', '-25px')

        }

        document.body.onmouseup = function (e) {

            docStyle.setProperty('--tz', '-12px')

        }
        // 3d hover effect end

    }

})

$(window).load(function () {
    /* Mobile Menu */
    $(".mobMenuIcon").click(function () {
        $(".mob-menu-box").addClass('in');
        $(".bgOverlay").addClass('in');
    });
    $(".mob-menu-close").click(function () {
        $(".mob-menu-box").removeClass('in');
        $(".bgOverlay").removeClass('in');
    });

    /* time track */
    $(".time-hed").click(function () {
        $(".time-track").removeClass('in');
    });

    /* Overlay */
    $(".bgOverlay").click(function () {
        $(".mob-menu-box").removeClass('in');
        $(".salon-side-bar").removeClass('in');
        $(".bgOverlay").removeClass('in');
    });

    if ($(window).width() > 990) {
        $('.time-track').animate({
            bottom: 0
        });

        /* time track */
        $(".time-hed").click(function () {
            $(".trak-sld").slideToggle();
        });
    } else {
        $('.sidebar-btn').animate({
            right: '20px'
        }, 500);
        setTimeout(() => {
            $('.time-track-btn').animate({
                right: '20px'
            }, 500);
        }, 100);

        /* time track */
        $(".time-track-btn").click(function () {
            $(".time-track").addClass('in');
        });

        /* Sidebar */
        $(".sidebar-btn").click(function () {
            $(".salon-side-bar").addClass('in');
            $(".bgOverlay").addClass('in');
        });
    }

    /* time track end */

});
